import React from "react";


import Home from "./pages/Home";
import About from "./pages/About";
import Gigs from "./pages/Gigs";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/' element={<Home/>} />

      </Routes>
    </Router>
  );
}

export default App;
